function App() {

  let ep = new Array();

  fetch("https://swapi.dev/api/films/")
    .then(response => response.json())
    .then((episodes) => { 

      for (let i = 0; i < episodes.results.length; i ++){
        console.log(episodes.results[i])
        ep.push(episodes.results[i]);
      }
    })
    .catch((error) => {
      console.log(error);
    });

  console.log("eps", ep);

  return (
    <div className="App">
      <h1>Hello</h1>

    </div>
  );
}

export default App;
